WeaveProperties.startupJavaScript:
var d = document.getElementById('weavePopup') || document.createElement('v');
d.id = 'weavePopup';
var style = {
  position: 'absolute',
  left: '400px',
  top: '300px',
  width: '200px',
  height: '50px',
  color: "#ffffff",
  fontWeight: 'bold',
  backgroundColor: '#800080',
  textAlign: 'center',
  lineHeight: '50px',
  fontSize: '25px'
};
for (var key in style)
  d.style[key] = style[key];
var value = document.getElementById('scriptInput').value;
d.innerHTML = value;
document.body.appendChild(d);
weave.setSessionState(['custom panel','properties'],{title: value}, false);

eventListeners.mouseMove:
data && event.buttonDown?{
  x += event.stageX - data.stageX;
  y += event.stageY - data.stageY;
}:{
  data = null
}
